import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./RegisterPatient.css";

const RegisterPatient = () => {
    const navigate = useNavigate();
    const [account, setAccount] = useState({
        username: "",
        password: "",
        email: "",
    });

    const [patient, setPatient] = useState({
        full_name: "",
        dob: "",
        gender: "Nam",
        phone: "",
        address: "",
    });

    const [errors, setErrors] = useState({});

    const handleAccountChange = (e) => {
        const { name, value } = e.target;
        setAccount({ ...account, [name]: value });
    };

    const handlePatientChange = (e) => {
        const { name, value } = e.target;
        setPatient({ ...patient, [name]: value });
    };

    const validate = () => {
        const newErrors = {};

        if (!account.username.trim()) newErrors.username = "Vui lòng nhập tên đăng nhập";
        if (!account.password || account.password.length < 6)
            newErrors.password = "Mật khẩu tối thiểu 6 ký tự";
        if (!account.email || !/^[\w-.]+@([\w-]+\.)+[\w-]{2,4}$/.test(account.email))
            newErrors.email = "Email không hợp lệ";

        if (!patient.full_name.trim()) newErrors.full_name = "Vui lòng nhập họ tên";
        if (!patient.dob) newErrors.dob = "Vui lòng chọn ngày sinh";
        if (!patient.phone || !/^0[0-9]{9}$/.test(patient.phone))
            newErrors.phone = "Số điện thoại không hợp lệ (bắt đầu bằng 0, đủ 10 số)";
        if (!patient.address.trim()) newErrors.address = "Vui lòng nhập địa chỉ";

        setErrors(newErrors);
        return Object.keys(newErrors).length === 0;
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        if (!validate()) return;

        try {
            const accRes = await fetch("http://localhost:3001/AccountPatient", {
                method: "POST",
                headers: { "Content-Type": "application/json" },
                body: JSON.stringify({
                    ...account,
                    img: "default.png",
                    status: "Enable",
                }),
            });

            if (!accRes.ok) throw new Error("Tạo tài khoản thất bại");
            const accData = await accRes.json();

            const patientRes = await fetch("http://localhost:3001/Patient", {
                method: "POST",
                headers: { "Content-Type": "application/json" },
                body: JSON.stringify({
                    ...patient,
                    id: accData.id,
                }),
            });

            if (!patientRes.ok) throw new Error("Lưu thông tin bệnh nhân thất bại");

            alert("Đăng ký thành công!");
            navigate("/login");
        } catch (err) {
            alert("Đăng ký thất bại!" + err.message);
        }
    };

    return (
        <div className="register-form-container">
            <form className="register-form" onSubmit={handleSubmit}>
                <h2>Đăng ký tài khoản bệnh nhân</h2>

                <label>Tên đăng nhập</label>
                <input name="username" onChange={handleAccountChange} />
                {errors.username && <span className="error">{errors.username}</span>}

                <label>Mật khẩu</label>
                <input type="password" name="password" onChange={handleAccountChange} />
                {errors.password && <span className="error">{errors.password}</span>}

                <label>Email</label>
                <input type="email" name="email" onChange={handleAccountChange} />
                {errors.email && <span className="error">{errors.email}</span>}

                <label>Họ và tên</label>
                <input name="full_name" onChange={handlePatientChange} />
                {errors.full_name && <span className="error">{errors.full_name}</span>}

                <label>Ngày sinh</label>
                <input type="date" name="dob" onChange={handlePatientChange} />
                {errors.dob && <span className="error">{errors.dob}</span>}

                <label>Giới tính</label>
                <select name="gender" onChange={handlePatientChange}>
                    <option value="Nam">Nam</option>
                    <option value="Nữ">Nữ</option>
                </select>

                <label>Số điện thoại</label>
                <input name="phone" onChange={handlePatientChange} />
                {errors.phone && <span className="error">{errors.phone}</span>}

                <label>Địa chỉ</label>
                <input name="address" onChange={handlePatientChange} />
                {errors.address && <span className="error">{errors.address}</span>}

                <button type="submit">Tạo tài khoản</button>
            </form>
        </div>
    );
};

export default RegisterPatient;
